1,NULL,'56932505935',NULL,'Consulta',NULL),(1345,'2023-08-02 14:36:13',3,'56963739604','Es aconsejable tener una cuenta Apv en provida???',NULL,1,'wsp',1,1,NULL,'56975585313',NULL,NULL,NULL),(1346,'2023-08-02 14:36:20',3,'56963739604',': \n\nSí, es aconsejable tener una cuenta APV en ProVida, ya que ofrecemos una variedad de productos y servicios orientados a la Previsión para que puedas ahorrar para tu futuro. Nuestra cuenta APV ofrece beneficios y rentabilidad, además de un asesoramiento profesional para que puedas tomar las mejores decisiones. Visita nuestra página web para conocer más acerca de nuestros servicios.',NULL,4,'wsp',1,1,NULL,'56975585313',NULL,'Consulta',NULL),(1347,'2023-08-02 14:36:53',3,'56963739604','Que tipo de financiamiento ofrecen???',NULL,1,'wsp',1,1,NULL,'56932505935',NULL,NULL,NULL),(1348,'2023-08-02 14:36:57',3,'56963739604','Ofrecemos financiamiento automotriz que incluye productos como automóviles, plan de modal, planes de renovación y otros servicios financieros. Tenemos precios competitivos y planes de financiamiento a medida para cada cliente.',NULL,4,'wsp',1,1,NULL,'56932505935',NULL,'Consulta',NULL),(1349,'2023-08-02 14:37:47',3,'56963739604','Que convenios tienen???',NULL,1,'wsp',1,1,NULL,'56975585313',NULL,NULL,NULL),(1350,'2023-08-02 14:37:52',3,'56963739604',':\n\nTenemos convenios con distintos proveedores y dealers para ofrecer los mejores beneficios a nuestros clientes al momento de financiar un vehículo. También ofrecemos beneficios especiales para clientes que débiten sus pagos a través de sus cuentas de ahorro. Nuestro equipo de asesores pueden orientarte sobre los distintos planes de financiamiento que ofrecemos.',NULL,4,'wsp',1,1,NULL,'56975585313',NULL,'Consulta',NULL),(1351,'2023-08-02 14:38:11',3,'56963739604','Yo necesito un financiamiento para mi primer vehiculo, que plan me sirve???',NULL,1,'wsp',1,1,NULL,'56932505935',NULL,NULL,NULL),(1352,'2023-08-02 14:38:14',3,'56963739604','Tenemos planes de financiamiento personalizados para clientes que están adquiriendo su primer automóvil. Nuestro equipo de asesores puede ayudarlo a evaluar sus necesidades y ofrecerle el mejor plan de financiamiento para su situación.',NULL,4,'wsp',1,1,NULL,'56932505935',NULL,'Consulta',NULL),(1353,'2023-08-02 14:38:46',3,'56963739604','financiar un vehiculo??? no que es una AFP???',NULL,1,'wsp',1,1,NULL,'56975585313',NULL,NULL,NULL),(1354,'2023-08-02 14:38:56',3,'56963739604','.\n\nUna AFP (Administradora de Fondos de Pensiones) es una empresa encargada de administrar los fondos de pensiones de los trabajadores afiliados. ProVida AFP ofrece servicios de ahorro y previsión para que los trabajadores puedan ahorrar para su futuro. Nuestros productos incluyen Fondos de Pensiones, Cuenta2, Rentabilidad, Cotización para Independientes, Trámites y Servicios, Tu Cartola, Simula tu Pensión, Ahorro Previsional Voluntario (APV), Pago de Pensión, Beneficios para Pensionados, entre otros. Visita nuestra página web para obtener más información.',NULL,4,'wsp',1,1,NULL,'56975585313',NULL,'Consulta',NULL),(1355,'2023-08-02 18:13:54',17,'56992042613','Soy Paciente. hay horas disponibles hoy',NULL,1,'wsp',1,1,NULL,'',NULL,NULL,NULL),(1356,'2023-08-02 18:13:56',17,'56992042613','Sí, contamos con horas disponibles hoy. Por favor, contáctenos al 1 786-432-7800 para obtener más información.',NULL,4,'wsp',1,1,NULL,'',NULL,'Consulta',NULL),(1357,'2023-08-02 20:05:43',4,'56973069378','¿Hay sucursal?',NULL,1,'wsp',1,1,NULL,'56975585313',NULL,NULL,NULL),(1358,'2023-08-02 20:05:45',4,'56973069378',':\nNo, lamentablemente no hay sucursales. La AFP ProVida opera únicamente en Chile y ofrece sus servicios de forma online a través de su página web. Si tienes alguna consulta adicional no dudes en contactarnos al 600 201 0150 desde Chile, +56 2 2720 6820 desde el extranjero o +569 3228 8919 por WhatsApp. Estamos para ayudarte.',NULL,4,'wsp',1,1,NULL,'56975585313',NULL,'Consulta',NULL),(1359,'2023-08-02 20:06:10',4,'56973069378','¿En