INSERT INTO `TBL_INTERACIONES` VALUES (1,NULL,NULL,'Hola soy la asistente virtual de USJMX y AST'),(2,1,2,'Te damos la bienvenida, primero que nada ¿Eres? \n 1- Paciente \n 2- Profesional'),(11,3,6,'Sabemos que eres Paciente:\r\n1- Pregunte cualquier duda que tenga\r\n2- Buscar Profesional por fecha/hora\r\n3 - Buscar Profesional por localidad\r\n4 - Iniciar sesión\r\n5 - Preguntas y respuestas\r\n6 - Condiciones de uso'),(18,4,6,'Sabemos que eres Profesional:\r\n1- Me quiero inscribir\r\n2- Iniciar sesión \r\n3- ¡Quiero ampliar mis servicios a domicilio! \r\n4- Preguntas y respuestas \r\n5- Condiciones de uso \r\n6- Contactar soporte '),(25,19,NULL,'Ingresa a este enlace y complete los datos del formulario de registro de profesional:\r\n\r\nhttps://www.go911.help/register_profesional_wizard.jsp'),(26,20,NULL,'Ingresa a https://www.go911.help/ y en la parte superior derecha hay un icono de usuario y hacer click se activa un formulario donde debes ingresar:\r\n\r\n - Tu identificador.\r\n - Tu correo electronico.\r\n - Tu contraseña.\r\n\r\nSi no recuerdas estos datos puedes pulsar el boton ¿Olvide contraseña?'),(27,21,NULL,'Debe ingresar a su perfil y en el usted, puede cambiar su fotografía, contraseña, actualizar horarios y sobretodo mantener actualizados los procedimientos en los cuales está capacitado para realizar en domicilios.\r\n\r\nIngresa a https://www.go911.help/ o revise como iniciar a su perfil.'),(28,22,NULL,'Ingrese a https://www.go911.help/faq.jsp y tiene una seccion donde pueder ver preguntas y respuestas mas comunes.'),(29,23,NULL,'Los terminos y condiciones de uso se encuentran en este link:\r\n\r\nhttps://www.go911.help/doc/TERMINOS_Y_CONDICIONES_DE_USO_GO911_v1.pdf'),(30,24,NULL,'Muchas Gracias estamos contactando aun en ejecutivo. Mantengase en linea.'),(31,12,NULL,'Muchas Gracias estamos contactando aun en ejecutivo. Mantengase en linea.'),(32,13,NULL,'La solicitud de atención se hace directamente en la plataforma, seleccionando al profesional requerido y día y hora de atención, se recomienda comenzar en el botón \"Domicilio\" o \"Telemedicina\".'),(33,14,NULL,'La solicitud de atención se hace directamente en la plataforma, seleccionando al profesional requerido y día y hora de atención, se recomienda comenzar en el botón \"Domicilio\" o \"Telemedicina\".'),(34,15,NULL,'Ingresa a https://www.go911.help/ y en la parte superior derecha hay un icono de usuario y hacer click se activa un formulario donde debes ingresar:\r\n\r\n - Tu identificador.\r\n - Tu correo electronico.\r\n - Tu contraseña.\r\n\r\nSi no recuerdas estos datos puedes pulsar el boton ¿Olvide contraseña?'),(35,16,NULL,'Ingrese a https://www.go911.help/faq.jsp y tiene una seccion donde pueder ver preguntas y respuestas mas comunes.'),(36,17,NULL,'Los terminos y condiciones de uso se encuentran en este link:\r\n\r\nhttps://www.go911.help/doc/TERMINOS_Y_CONDICIONES_DE_USO_GO911_v1.pdf');
